(263, '302', 'VKFF-0260', 'VK-0579', 'OC-195', '', '', 'VKP-0925', 'CAPAD_M', '27/04/1971', 'II', NULL, 'Kent Group', 'VK7', 'AU.TS', 'NP', 'Launceston and North East', 'North East', '', 'Deal Island AU 0129\nDeal Island, the largest island of the Kent Group, is a 1,576-hectare granite island, located in northern Bass Strait, that lies between the Furneaux Group, north-east of Tasmania and Wilsons Promontory in Victoria, Australia.\nThe Deal Island Lighthouse (AU 0129) in Bass Strait was first turned on in 1848. It was built jointly by the New South Wales, Victorian and Tasmanian Governments. It is not only the highest light in Australia, but also in the Southern Hemisphere.\n', 'http://www.parks.tas.gov.au/indeX.aspX?base=3429', 147.323472, -39.465527, '31283', 'OC / VK-TAS', 'active', NULL, NULL, NULL, NULL),
