(272, 'NSW_N0018', 'VKFF-0269', 'VK-1881', 'OC-001', '', '', 'VKP-0116', 'CAPAD_T', '1/10/1967', 'II', NULL, 'Kosciuszko', 'VK2', 'AU.NS', 'NP', 'Riverina', 'Tumut - Tumbarumba', '', 'From Andrew VK2DA; \r\nFollowing a problem encountered by one of the SOTA activations at Mt Kosciuszko at the end of December 2003, enquiries have been made with the Kosciuszko National Park management at Jindabyne. \r\nWith the able help of Adrian Blake VK2ALF I can now advise that Park Administrators now understand fully what our interest is in operating from summits in the park. Adrian has provided the following recommendation.\r\n\"Each time you wish to visit Kosciuszko or any other significant peak within the park, please send Anthony Evans (Anthony.evans at environment.nsw.gov.au) a simple e-mail of your intentions, specifying the date and the number of people. Also send copy to Tim Greville ( Tim.Greville at environment.nsw.gov.au) and include a statement that you will respect the other visitors to the summit and the environment.\" \r\nCheckout - https://www.sota.org.uk/Article/VK2/SM-001/11296 for further information\r\n', 'https://www.nationalparks.nsw.gov.au/visit-a-park/parks/kosciuszko-national-park', 148.372000, -36.107000, '688747.17', 'OC / VK-NSW', 'active', NULL, 96, '2019-12-28', 'VK1DI'),
