(312, 'NSW_N0143', 'VKFF-0309', 'VK-1842', 'OC-001', '', '', 'VKP-0130', 'CAPAD_T', '1/01/1999', 'II', NULL, 'Maryland', 'VK2', 'AU.NS', 'NP', 'New England and North West', 'Inverell - Tenterfield', '', '	No Telstra phone service. 	No Toilets. 	No park benches. 	Easy access. 	A fair bit of the park is land-locked by private properties, but access is available via public roads, here are the directions from Stanthorpe I got from the Ranger at Tenterfield. 	Take Amosfield Rd from Stanthorpe, turn left onto Mt Lindsey Rd, turn left onto Cullendore Rd then left onto Maryland-Cullendore Rd (This road goes through the park). 	Its about a 45km trip from Stanthorpe. 	From the Mt Lindsey turn-off it is about 11kms to the park entrance. There is a park sign indicating it is Maryland NP and a closed gate. The gate is not locked. 	You will go through about 4 cattle grids and at times it will look like private property, but it is all public road according to the Ranger. 	We ended up a few hundred metr', 'https://www.nationalparks.nsw.gov.au/visit-a-park/parks/maryland-national-park', 152.076700, -28.499000, '2280.99', 'OC / VK-NSW', 'active', NULL, 3, '2019-10-27', 'VK2XSE'),
