(620, 'VIC_3287', 'VKFF-0618', 'VK-0515', 'OC-001', '', '3NP-001', 'VKP-0234', 'CAPAD_T', '30/10/1956', 'II', NULL, 'Alfred', 'VK3', 'AU.VI', 'NP', 'Latrobe - Gippsland', 'Gippsland - East', 'Parks Victoria', 'The Alfred National Park is a national park located in the East Gippsland region of the Australian state of Victoria. The 3,050-hectare (7,500-acre)national park is situated approximately 388 kilometres (241 mi) east of Melbourne and was declared in 1925.The park is dissected by the Princes Highway, between Cann River and Genoa.', 'http://parkweb.vic.gov.au/explore/parks/alfred-national-park', 149.362700, -37.572100, '3021.75', 'OC / VK-VIC', 'active', '', 51, '2019-11-10', 'VK5DG'),
(621, 'VIC_3319', 'VKFF-0619', 'VK-0514', 'OC-001', '', '3NP-002', 'VKP-0235', 'CAPAD_T', '26/04/1979', 'II', NULL, 'Alpine', 'VK3', 'AU.VI', 'NP', 'Hume', 'Wodonga - Alpine', 'Parks Victoria', 'The Alpine National Park is a national park located in the Central Highlands and Alpine regions of Victoria, Australia. The 646,000-hectare (1,600,000-acre) national park is located northeast of Melbourne and covers much of the higher areas of the Great Dividing Range in Victoria, including Victoria\'s highest point, Mount Bogong at 1,986 metres (6,516 ft)', 'http://parkweb.vic.gov.au/explore/parks/alpine-national-park', 147.336700, -37.031700, '662304.70', 'OC / VK-VIC', 'active', '', 251, '2019-12-09', 'VK3PAT'),
(622, 'VIC_3314', 'VKFF-0620', 'VK-0461', 'OC-001', '', '3NP-007', 'VKP-0249', 'CAPAD_T', '26/04/1980', 'II', NULL, 'Chiltern-Mount Pilot', 'VK3', 'AU.VI', 'NP', 'Hume', 'Wodonga - Alpine', 'Parks Victoria', 'The Chiltern-Mt Pilot National Park is a national park that is located in the Hume region of Victoria, Australia.[2] The 21,650-hectare (53,500-acre) national park is situated approximately 275 kilometres (171 mi) northeast of Melbourne, and extends west from Beechworth across the Hume Freeway and the Albury-Melbourne railway line to the west of Chiltern', 'http://parkweb.vic.gov.au/explore/parks/chiltern-mt-pilot-national-park', 146.683000, -36.248800, '21666.02', 'OC / VK-VIC', 'active', '', 44, '2019-11-10', 'VK3PF'),
(623, 'VIC_3293', 'VKFF-0621', 'VK-0459', 'OC-001', '', '3NP-008', 'VKP-0250', 'CAPAD_T', '12/02/1941', 'III', NULL, 'Churchill', 'VK3', 'AU.VI', 'NP', 'Melbourne - South East', 'Casey - North', 'Parks Victoria', 'The Churchill National Park is a national park located in the Greater Melbourne region of Victoria, Australia. The 271-hectare (670-acre)[1] national park is situated 31 kilometres (19 mi) southeast of Melbourne adjacent to the suburb of Lysterfield South, which lies between Rowville and Endeavour Hills in the far north of the City of Casey. The national park is near the Monash Freeway and Stud Road.', 'http://parkweb.vic.gov.au/explore/parks/churchill-national-park', 145.260400, -37.950100, '271.84', 'OC / VK-VIC', 'active', '', 43, '2019-11-10', 'VK3ZPF'),
(624, 'VIC_3301', 'VKFF-0622', 'VK-0417', 'OC-136', '', '3NP-014', 'VKP-0259', 'CAPAD_T', '21/06/1988', 'II', NULL, 'French Island', 'VK3', 'AU.VI', 'NP', 'Latrobe - Gippsland', 'Gippsland - South West', 'Parks Victoria', 'French Island is the largest coastal island of Victoria, Australia, located in Western Port, 61 km (38 mi) southeast of Melbourne. In 1997 about 70 per cent of the island was declared the French Island National Park, and is listed in the register of the National Estate.', 'http://parkweb.vic.gov.au/explore/parks/french-island-national-park', 145.383700, -38.335600, '10322.85', 'OC / VK-VIC', 'active', '', 22, '2019-04-05', 'VK6MB'),
(625, 'VIC_4492', 'VKFF-0623', 'VK-0401', 'OC-001', '', '3NP-017', 'VKP-0263', 'CAPAD_T', '26/06/1986', 'II', NULL, 'Greater Bendigo', 'VK3', 'AU.VI', 'NP', 'Bendigo', 'Loddon - Elmore', 'Parks Victoria', 'The Greater Bendigo National Park is a national park located in the Loddon Mallee region of Victoria, Australia.[2] The 17,020-hectare (42,100-acre) national park was created in 2002 from the former Whipstick State Park, Kamarooka State Park, One Tree Hill Regional Park, Mandurang State Forest and the Sandhurst State Forest.', 'http://parkweb.vic.gov.au/explore/parks/greater-bendigo-national-park', 144.441900, -36.521200, '17325.35', 'OC / VK-VIC', 'active', '', 32, '2019-06-04', 'VK2IO'),
(626, 'VIC_4493', 'VKFF-0624', 'VK-0391', 'OC-001', '', '3NP-020', 'VKP-0266', 'CAPAD_T', '30/10/2002', 'II', NULL, 'Heathcote-Graytown', 'VK3', 'AU.VI', 'NP', 'Hume', 'Upper Goulburn Valley', 'Parks Victoria', 'The Heathcote-Graytown National Park is a national park located in the North Central region of Victoria, Australia. The 12,833-hectare (31,710-acre) national park, which includes sections of the Great Dividing Range, adjoins a number of state forests, including the McIvor Ranges State Forest and is located just outside the town of Heathcote.', 'http://parkweb.vic.gov.au/explore/parks/heathcote-graytown-national-park', 144.975400, -36.781600, '12692.92', 'OC / VK-VIC', 'active', '', 37, '2019-11-09', 'VK3XV'),
(627, 'VIC_3294', 'VKFF-0625', 'VK-0363', 'OC-001', '', '3NP-023', 'VKP-0271', 'CAPAD_T', '18/12/1957', 'II', NULL, 'Lake Eildon', 'VK3', 'AU.VI', 'NP', 'Hume', 'Upper Goulburn Valley', 'Parks Victoria', 'The Lake Eildon National Park is a national park in the Central Highlands region of Victoria, Australia. The 27,750-hectare (68,600-acre) national park is set in the northern foothills of the Central Highlands, approximately 111 kilometres (69 mi) northeast of Melbourne and abuts the shores of Lake Eildon.', 'http://parkweb.vic.gov.au/explore/parks/lake-eildon-national-park', 145.986500, -37.306300, '27861.36', 'OC / VK-VIC', 'active', '', 31, '2020-06-20', 'VK3ZPF'),
(628, 'VIC_3302', 'VKFF-0626', 'VK-0327', 'OC-001', '', '3NP-030', 'VKP-0283', 'CAPAD_T', '29/11/1966', 'III', NULL, 'Morwell', 'VK3', 'AU.VI', 'NP', 'Latrobe - Gippsland', 'Latrobe Valley', 'Parks Victoria', 'The Morwell National Park is a national park located in the western Gippsland region of Victoria, Australia.', 'http://parkweb.vic.gov.au/explore/parks/morwell-national-park', 146.390400, -38.365500, '565.32', 'OC / VK-VIC', 'active', '', 44, '2019-11-09', 'VK3ZPF'),
(629, 'VIC_3306', 'VKFF-0627', 'VK-0287', 'OC-001', '', '3NP-035', 'VKP-0296', 'CAPAD_T', '14/12/1971', 'III', NULL, 'Organ Pipes', 'VK3', 'AU.VI', 'NP', 'Melbourne - North West', 'Brimbank', 'Parks Victoria', 'The Organ Pipes National Park, abbreviated as OPNP, is a national park located in the Central region of Victoria, Australia.', 'http://parkweb.vic.gov.au/explore/parks/organ-pipes-national-park', 144.768400, -37.667500, '152.56', 'OC / VK-VIC', 'active', '', 42, '2019-11-09', 'VK3TKK'),
(630, 'VIC_4711', 'VKFF-0628', 'VK-0276', 'OC-001', '', '3NP-036', 'VKP-0298', 'CAPAD_T', '17/08/2005', 'II', NULL, 'Point Nepean', 'VK3', 'AU.VI', 'NP', 'Mornington Peninsula', 'Mornington Peninsula', 'Parks Victoria', 'Point Nepean National Park has a rich history and played an important role in shaping the early settlement, quarantine and defence of Victoria.The park is located at the very tip of the Mornington Peninsula, with outstanding coastal scenery and panoramic views of Bass Strait, the Rip and Port Phillip Bay.', 'http://parkweb.vic.gov.au/explore/parks/point-nepean-national-park', 144.683500, -38.315500, '542.35', 'OC / VK-VIC', 'active', '', 32, '2020-02-25', 'VK3PI'),
