(730, 'VIC_4862', 'VKFF-0728', 'VK-0458', 'OC-001', '', '3NP-009', 'VKP-0251', 'CAPAD_T', '11/11/2008', 'II', NULL, 'Cobboboonee', 'VK3', 'AU.VI', 'NP', 'Warrnambool and South West', 'Glenelg - Southern Grampians', 'Parks Victoria', 'The Cobboboonee National Park is a national park located in the Barwon South West region of Victoria, Australia. The 18,510-hectare (45,700-acre) national park is situated approximately 360 kilometres (220 mi) west of Melbourne city centre, with access via the town of Heywood near the junctions of the Princes and Henty highways, north of Portland.', 'http://parkweb.vic.gov.au/explore/parks/cobboboonee-national-park', 141.440000, -38.114400, '18525.46', 'OC / VK-VIC', 'active', '', 26, '2019-06-06', 'VK2IO'),
