(741, 'VIC_4882', 'VKFF-0739', 'VK-0502', 'OC-001', '', '3NP-003', 'VKP-0237', 'CAPAD_T', '27/06/2010', 'II', NULL, 'Barmah', 'VK3', 'AU.VI', 'NP', 'Shepparton', 'Moira', 'Parks Victoria', 'The Barmah National Park is a national park located in the Hume region of the Australian state of Victoria.The 28,500-hectare (70,000-acre) park is located adjacent to the Murray River near the town of Barmah, approximately 220 kilometres (140 mi) north of Melbourne. The park consists of River Red Gum (Eucalyptus camaldulensis) forest and wetlands. The area is subject to sporadic flooding from natural and irrigation water flows.', 'http://parkweb.vic.gov.au/explore/parks/barmah-national-park', 145.076100, -35.886100, '28437.46', 'OC / VK-VIC', 'active', '', 20, '2019-06-27', 'VK6MB'),
(742, 'VIC_4884', 'VKFF-0740', 'VK-0395', 'OC-001', '', '3NP-018', 'VKP-0264', 'CAPAD_T', '27/06/2010', 'II', NULL, 'Gunbower', 'VK3', 'AU.VI', 'NP', 'North West', 'Murray River - Swan Hill', 'Parks Victoria', 'The Gunbower National Park is a national park located in the Loddon Mallee region of Victoria, Australia. The 9,330-hectare (23,100-acre) national park is situated between Echuca and Koondrook adjacent to the banks of the Murray River, approximately 250 kilometres (160 mi) north of Melbourne', 'http://parkweb.vic.gov.au/explore/parks/gunbower-national-park', 144.284200, -35.801200, '9236.00', 'OC / VK-VIC', 'active', '', 21, '2019-11-10', 'VK3FLCS'),
(743, 'VIC_4885', 'VKFF-0741', 'VK-0346', 'OC-001', '', '3NP-027', 'VKP-0279', 'CAPAD_T', '27/06/2010', 'II', NULL, 'Lower Goulburn', 'VK3', 'AU.VI', 'NP', 'Shepparton', 'Shepparton', 'Parks Victoria', 'The Lower Goulburn National Park is a national park located in the Goulburn Valley district of Victoria, Australia.', 'http://parkweb.vic.gov.au/explore/parks/lower-goulburn-national-park', 145.306100, -36.256900, '9307.38', 'OC / VK-VIC', 'active', '', 17, '2019-12-01', 'VK3ZK'),
(744, 'VIC_4886', 'VKFF-0742', 'VK-0214', 'OC-001', '', '3NP-042', 'VKP-0306', 'CAPAD_T', '27/06/2010', 'II', NULL, 'Warby Ovens', 'VK3', 'AU.VI', 'NP', 'Hume', 'Wangaratta - Benalla', 'Parks Victoria', 'The Warby-Ovens National Park is a national park located in the Hume region of Victoria, Australia. The 14,655-hectare national park is situated approximately 10 kilometres west of Wangaratta and 240 kilometres northeast of Melbourne.', 'http://parkweb.vic.gov.au/explore/parks/warby-ovens-national-park', 146.185600, -36.276300, '14707.73', 'OC / VK-VIC', 'active', '', 28, '2019-11-09', 'VK4AAC'),
(745, 'VIC_3358', 'VKFF-0743', 'VK-0500', 'OC-001', '', '', 'VKP-0239', 'CAPAD_T', '4/06/1997', 'III', NULL, 'Bay of Islands', 'VK3', 'AU.VI', 'COP', 'Warrnambool and South West', 'Warrnambool', 'Parks Victoria', 'Bay of Islands Coastal Park is a 32 kilometre long coastal reserve located on the Great Ocean Road between Peterborough and Warrnambool in Australia. Lookout areas with parking are provided at the Bay of Martyrs, the Bay of Islands, Three Mile Beach and Childers Cove.', 'http://parkweb.vic.gov.au/explore/parks/bay-of-islands-coastal-park', 142.711400, -38.514000, '934.82', 'OC / VK-VIC', 'active', '', 7, '6/06/2018', 'VK4AAC'),
(746, 'VIC_3359', 'VKFF-0744', 'VK-0470', 'OC-001', '', '', 'VKP-0245', 'CAPAD_T', '4/06/1997', 'II', NULL, 'Cape Conran', 'VK3', 'AU.VI', 'COP', 'Latrobe - Gippsland', 'Gippsland - East', 'Parks Victoria', 'Cape Conran Coastal Park is a coastal reserve located near Marlo in East Gippsland in Victoria, Australia. The 11,700 hectare area was declared a coastal park under the National Parks Act in 1997.It is 420 km east of Melbourne and 530 km south of Sydney.', 'http://parkweb.vic.gov.au/explore/parks/cape-conran-coastal-park', 148.853900, -37.768400, '11577.46', 'OC / VK-VIC', 'active', '', 9, '2019-09-25', 'VK3VJP'),
(747, 'VIC_3371', 'VKFF-0745', 'VK-0468', 'OC-001', '', '', 'VKP-0246', 'CAPAD_T', '4/06/1997', 'II', NULL, 'Cape Liptrap', 'VK3', 'AU.VI', 'COP', 'Latrobe - Gippsland', 'Gippsland - South West', 'Parks Victoria', 'Cape Liptrap coastal park is located in south Gippsland, Victoria and is a peninsula that is the extension of the Hoddle Range that runs out to sea. It was sighted by Lieutenant James Grant on 9 December 1800 from the survey brig HMS Lady Nelson and named after John Liptrap.At the end of the peninsula is Cape Liptrap Lighthouse.', 'http://parkweb.vic.gov.au/explore/parks/cape-liptrap-coastal-park', 145.870000, -38.770900, '4317.67', 'OC / VK-VIC', 'active', '', 12, '2019-08-02', 'VK3PF'),
(748, 'VIC_3360', 'VKFF-0746', 'VK-0433', 'OC-001', '', '', 'VKP-0256', 'CAPAD_T', '26/04/1979', 'III', NULL, 'Discovery Bay', 'VK3', 'AU.VI', 'COP', 'Warrnambool and South West', 'Glenelg - Southern Grampians', 'Parks Victoria', 'The Discovery Bay Coastal Park is a linear protected area of coastal land in western Victoria, south-eastern Australia. The 10,460-hectare (25,800-acre) park extends along the coast of Discovery Bay from Cape Nelson north-westwards for 50 kilometres (31 mi) to the border with South Australia.', 'http://parkweb.vic.gov.au/explore/parks/discovery-bay-coastal-park', 141.302100, -38.214800, '10641.41', 'OC / VK-VIC', 'active', '', 6, '2019-06-10', 'VK2IO'),
(749, 'VIC_3362', 'VKFF-0747', 'VK-0414', 'OC-001', '', '', 'VKP-0260', 'CAPAD_T', '26/04/1979', 'VI', NULL, 'Gippsland Lakes', 'VK3', 'AU.VI', 'COP', 'Latrobe - Gippsland', 'Wellington', 'Parks Victoria', 'The Gippsland Lakes Coastal Park is a coastal park in the East Gippsland region of Victoria, Australia. The park is located approximately 240 km east of the capital city of Melbourne.', 'http://parkweb.vic.gov.au/explore/parks/gippsland-lakes-coastal-park', 147.779800, -37.956100, '17786.30', 'OC / VK-VIC', 'active', '', 22, '2019-03-15', 'VK6MB'),
(750, '365', 'VKFF-0748', 'VK-0293', 'OC-001', '', '', 'VKP-0295', 'CAPAD_M', '18/04/1986', 'VI', NULL, 'Nooramunga', 'VK3', 'AU.VI', 'CMP', '', '', 'Parks Victoria', 'Nooramunga Marine and Coastal Park is located in the Gippsland region of Victoria, Australia. Snake Island lies within the Nooramunga Marine and Coastal Park and is part of a complex of barrier islands that protect a large marine embayment from the pounding waves of Bass Strait.', 'http://parkweb.vic.gov.au/explore/parks/nooramunga-marine-and-coastal-park', 146.563100, -38.739200, '30074.08', 'OC / VK-VIC', 'active', '', 5, '2018-11-09', 'VK3AAK'),
(751, '363', 'VKFF-0749', 'VK-0260', 'OC-001', '', '', 'VKP-0301', 'CAPAD_M', '18/04/1986', 'VI', NULL, 'Shallow Inlet', 'VK3', 'AU.VI', 'CMP', 'Latrobe - Gippsland', 'Gippsland - South West', 'Parks Victoria', 'Shallow Inlet is a marine inlet, opening onto Waratah Bay on the western side of the Yanakie Isthmus in South Gippsland, Victoria, south-eastern Australia. It lies close to the small holiday communities of Sandy Point and Yanakie, as well as to Wilsons Promontory and the Wilsons Promontory National Park.', 'http://parkweb.vic.gov.au/explore/parks/shallow-inlet-marine-and-coastal-park', 146.173600, -38.853900, '1972.33', 'OC / VK-VIC', 'active', '', 9, '2019-05-18', 'VK3PF'),
(752, 'VIC_3326', 'VKFF-0750', 'VK-0511', 'OC-001', '', '', 'VKP-0236', 'CAPAD_T', '16/05/1978', 'III', NULL, 'Arthurs Seat', 'VK3', 'AU.VI', 'SP', 'Mornington Peninsula', 'Mornington Peninsula', 'Parks Victoria', 'Arthurs Seat is a hill and locality on the Mornington Peninsula, within the Shire of Mornington Peninsula, about 75 km south east of Melbourne, Australia.Arthurs Seat is a major tourist attraction, owing to its natural bushland, sweeping views and man-made attractions. The hill rises to 314 meters (1031 ft) above sea level.', 'http://parkweb.vic.gov.au/explore/parks/arthurs-seat-state-park', 144.948500, -38.359800, '565.91', 'OC / VK-VIC', 'active', '', 32, '2020-02-02', 'VK3ALN'),
(753, 'VIC_3328', 'VKFF-0751', 'VK-0492', 'OC-001', '', '', 'VKP-0240', 'CAPAD_T', '21/06/1988', 'II', NULL, 'Black Range', 'VK3', 'AU.VI', 'SP', 'North West', 'Grampians', 'Parks Victoria', 'Black Range State Park is a state park located 340 km (210 mi) northwest of Melbourne, Australia, near the town of Cavendish, covering an area of 117 square kilometres (29,000 acres).In addition to natural flora and fauna, the park protects Aboriginal art and occupation sites of the Jardwadjali people. The area\'s steep, rocky terrain meant it was never cleared by pastoralists, and has essentially remained in its natural condition.', 'http://parkweb.vic.gov.au/explore/parks/black-range-state-park', 142.070400, -37.150100, '11730.97', 'OC / VK-VIC', 'active', '', 11, '2019-11-30', 'VK3CU'),
(754, 'VIC_4495', 'VKFF-0752', 'VK-0484', 'OC-001', '', '', 'VKP-0242', 'CAPAD_T', '30/10/2002', 'III', NULL, 'Broken-Boosey', 'VK3', 'AU.VI', 'SP', 'Shepparton', 'Moira', 'Parks Victoria', 'Broken-Boosey State Park is a linear corridor along sections of Nine Mile Creek, Boosey Creek, and Broken Creek, between Shepparton and Tocumwal, in Victoria\'s north. It covers 1,030 hectares (4.0 sq mi), and was declared in 2002. It protects some of the few remaining stands of native vegetation in this part of Victoria, including threatened species such as coolibah grass, spiny-fruit saltbush and pepper grass.', 'http://parkweb.vic.gov.au/explore/parks/broken-boosey-state-park', 145.572337, -36.121333, '1011', 'OC / VK-VIC', 'active', '', 7, '2019-08-11', 'VK4AAC'),
(755, 'VIC_3329', 'VKFF-0753', 'VK-0477', 'OC-001', '', '', 'VKP-0243', 'CAPAD_T', '23/09/1992', 'II', NULL, 'Bunyip', 'VK3', 'AU.VI', 'SP', 'Melbourne - South East', 'Cardinia', 'Parks Victoria', 'Bunyip State Park is a 166-square-kilometre (64 sq mi) state park 65 kilometres (40 mi) east of Melbourne, near the town of Gembrook, in the southern slopes of the Yarra Ranges within the Australian state of Victoria.', 'http://parkweb.vic.gov.au/explore/parks/bunyip-state-park', 145.691602, -37.979072, '16647', 'OC / VK-VIC', 'active', '', 27, '2019-01-06', 'VK3ZPF'),
(756, 'VIC_3330', 'VKFF-0754', 'VK-0467', 'OC-001', '', '', 'VKP-0247', 'CAPAD_T', '26/04/1979', 'III', NULL, 'Cape Nelson', 'VK3', 'AU.VI', 'SP', 'Warrnambool and South West', 'Glenelg - Southern Grampians', 'Parks Victoria', 'The Cape Nelson State Park, near Portland on Victoria\'s southwest coast is a 243-hectare (600-acre) state park.Attractions include a 3-kilometre (2 mi) clifftop walk and a visit to the Cape Nelson lighthouse. The lighthouse was completed in 1884 and today offers accommodation in the Light Station Keepers Cottages. Part of the course of the Great South West Walk is located within the park', 'http://parkweb.vic.gov.au/explore/parks/cape-nelson-state-park', 141.533700, -38.426400, '228.96', 'OC / VK-VIC', 'active', '', 5, '2019-05-30', 'VK6MB'),
(757, 'VIC_3332', 'VKFF-0755', 'VK-0463', 'OC-001', '', '', 'VKP-0248', 'CAPAD_T', '26/04/1979', 'II', NULL, 'Cathedral Range', 'VK3', 'AU.VI', 'SP', 'Hume', 'Upper Goulburn Valley', 'Parks Victoria', 'The Cathedral Range is a mountain range that is part of the Great Dividing Range in Victoria, Australia, located in Cathedral Range State Park. The range is formed from a 7 kilometres (4.3 mi) ridge of upturned sedimentary rock, consisting mainly of sandstone, mudstone and conglomerates of the Devonian Period. This has given the range steep sides, and a narrow razorback ridge.', 'http://parkweb.vic.gov.au/explore/parks/cathedral-range-state-park', 145.745600, -37.382400, '3599.36', 'OC / VK-VIC', 'active', '', 11, '2020-06-20', 'VK3ZPF'),
(758, 'VIC_3333', 'VKFF-0756', 'VK-0435', 'OC-001', '', '', 'VKP-0255', 'CAPAD_T', '23/09/1992', 'II', NULL, 'Dergholm', 'VK3', 'AU.VI', 'SP', 'North West', 'Grampians', 'Parks Victoria', 'The Dergholm State Park is located in the far west of Victoria, Australia. It is 390 km west of Melbourne and 450 km east of Adelaide, South Australia.', 'http://parkweb.vic.gov.au/explore/parks/dergholm-state-park', 141.304200, -37.331400, '10887.53', 'OC / VK-VIC', 'active', '', 5, '2019-06-02', 'VK6MB'),
(759, 'VIC_3356', 'VKFF-0757', 'VK-0423', 'OC-001', '', '', 'VKP-0257', 'CAPAD_T', '3/08/1995', 'II', NULL, 'Enfield', 'VK3', 'AU.VI', 'SP', 'Ballarat', 'Maryborough - Pyrenees', 'Parks Victoria', 'Enfield State Park is a 4,400-hectare (11,000-acre) state park near the locality of Enfield, approximately 25 kilometres (16 mi) south of Ballarat, in Victoria, Australia. The Park contains a diverse range of flora and fauna, some of which are significant, and also extensive evidence of the mining and forestry activities that were undertaken throughout the area from the late 1850s to the 1960s. It was opened in 1995.', 'http://parkweb.vic.gov.au/explore/parks/enfield-state-park', 143.743211, -37.747265, '4323', 'OC / VK-VIC', 'active', '', 13, '6/03/2018', 'VK5HSX'),
(760, 'VIC_3334', 'VKFF-0758', 'VK-0389', 'OC-001', '', '', 'VKP-0267', 'CAPAD_T', '16/05/1978', 'II', NULL, 'Holey Plains', 'VK3', 'AU.VI', 'SP', 'Latrobe - Gippsland', 'Wellington', 'Parks Victoria', 'Holey Plains State Park is a 10,638-hectare (26,290-acre) state park in East Gippsland, Victoria in south-eastern Australia. It is known for its exceptionally diverse flora, with about one in five plant species known in Victoria present in the park. The park is situated between Rosedale and Sale.', 'http://parkweb.vic.gov.au/explore/parks/holey-plains-state-park', 146.935800, -38.230200, '10745.60', 'OC / VK-VIC', 'active', '', 14, '2019-07-18', 'VK3PF'),
(761, 'VIC_3337', 'VKFF-0759', 'VK-0366', 'OC-001', '', '', 'VKP-0270', 'CAPAD_T', '18/12/1984', 'II', NULL, 'Kooyoora', 'VK3', 'AU.VI', 'SP', 'Bendigo', 'Loddon - Elmore', 'Parks Victoria', 'Kooyoora State Park is a state park in Victoria, Australia located 220 kilometres (140 mi) northwest of Melbourne, and 12 km west of Inglewood. It is a 11,350-hectare (28,000-acre) reserve comprising box-ironbark forest and rocky granite outcrops, including the Melville Caves.', 'http://parkweb.vic.gov.au/explore/parks/kooyoora-state-park', 143.689480, -36.591930, '11459', 'OC / VK-VIC', 'active', '', 11, '2019-09-02', 'VK6MB'),
(762, 'VIC_3338', 'VKFF-0760', 'VK-0358', 'OC-001', '', '', 'VKP-0273', 'CAPAD_T', '8/12/1984', 'II', NULL, 'Langi Ghiran', 'VK3', 'AU.VI', 'SP', 'North West', 'Grampians', 'Parks Victoria', 'The Langi Ghiran State Park is 14 km east of Ararat in the state of Victoria, Australia. The park covers an area of 2695 ha.', 'http://parkweb.vic.gov.au/explore/parks/langi-ghiran-state-park', 143.100000, -37.309700, '3043.22', 'OC / VK-VIC', 'active', '', 16, '2020-06-14', 'VK3ARH'),
(763, 'VIC_3419', 'VKFF-0761', 'VK-0362', 'OC-001', '', '', 'VKP-0272', 'CAPAD_T', '19/06/1984', 'III', NULL, 'Lake Tyers', 'VK3', 'AU.VI', 'SP', 'Latrobe - Gippsland', 'Gippsland - East', 'Parks Victoria', 'Lake Tyers State Park extends from Lake Tyers Beach to Mount Nowa Nowa.  Tall eucalypt forests surround the northern shores of Lake Tyers, and a thin sand spit divides the lake from the ocean.', 'http://parkweb.vic.gov.au/explore/parks/lake-tyers', 148.067700, -37.800000, '8693.89', 'OC / VK-VIC', 'active', '', 17, '2019-10-06', 'VK1DI'),
(764, 'VIC_3354', 'VKFF-0762', 'VK-0356', 'OC-001', '', '', 'VKP-0274', 'CAPAD_T', '23/09/1992', 'II', NULL, 'Leaghur', 'VK3', 'AU.VI', 'SP', 'Bendigo', 'Loddon - Elmore', 'Parks Victoria', 'Leaghur State Park is a 2,022-hectare state park approximately 25 kilometres south-west of Kerang, in Victoria, Australia. The Park protects some of the most significant Black Box wetlands and woodlands in Victoria.', 'http://parkweb.vic.gov.au/explore/parks/leaghur-state-park', 143.814458, -35.944795, '2045', 'OC / VK-VIC', 'active', '', 8, '2019-11-30', 'VK3XV'),
(765, 'VIC_3339', 'VKFF-0763', 'VK-0354', 'OC-001', '', '', 'VKP-0275', 'CAPAD_T', '21/06/1988', 'II', NULL, 'Lerderderg', 'VK3', 'AU.VI', 'SP', 'Ballarat', 'Creswick - Daylesford - Ballan', 'Parks Victoria', 'Lerderderg State Park is a 14,250 hectare park located between Bacchus Marsh and Blackwood, an hour\'s drive from Melbourne, Australia.', 'http://parkweb.vic.gov.au/explore/parks/lerderderg-state-park', 144.386314, -37.550204, '20565', 'OC / VK-VIC', 'active', '', 24, '2019-07-31', 'VK3FLCS'),
(766, 'VIC_3341', 'VKFF-0764', 'VK-0330', 'OC-001', '', '', 'VKP-0281', 'CAPAD_T', '18/12/1984', 'II', NULL, 'Moondarra', 'VK3', 'AU.VI', 'SP', 'Latrobe - Gippsland', 'Baw Baw', 'Parks Victoria', 'Moondarra State Park is on the northern edge of the Latrobe Valley, east of Melbourne, Australia.', 'http://parkweb.vic.gov.au/explore/parks/moondarra-state-park', 146.316300, -38.067200, '6337.64', 'OC / VK-VIC', 'active', '', 12, '2020-08-01', 'VK3YV'),
(767, 'VIC_3342', 'VKFF-0765', 'VK-0325', 'OC-001', '', '', 'VKP-0284', 'CAPAD_T', '17/12/1987', 'II', NULL, 'Mount Arapiles-Tooan', 'VK3', 'AU.VI', 'SP', 'North West', 'Grampians', 'Parks Victoria', 'The Mount Arapiles-Tooan State Park is a state park in the Wimmera plains of western Victoria, Australia. It encompasses Mount Arapiles, Mitre Rock, and the Tooan block.', 'http://parkweb.vic.gov.au/explore/parks/mount-arapiles-tooan-state-park', 141.698892, -36.781625, '7457', 'OC / VK-VIC', 'active', '', 17, '2019-09-29', 'VK3CU'),
(768, 'VIC_3343', 'VKFF-0766', 'VK-0323', 'OC-001', '', '', 'VKP-0286', 'CAPAD_T', '27/10/1989', 'II', NULL, 'Mount Buangor', 'VK3', 'AU.VI', 'SP', 'North West', 'Grampians', 'Parks Victoria', 'Mount Buangor State Park is located 60 kilometres west of Ballarat, Victoria in Bayindeen. [1][2][3] The 2400 hectare Park takes in varied eucalypt forest, creek flats, a waterfall, steep escarpments and Mount Buangor, the area\'s highest peak (987 m.). The park contains a 15 km network of walking trails', 'http://parkweb.vic.gov.au/explore/parks/mount-buangor-state-park', 143.203200, -37.304600, '2499', 'OC / VK-VIC', 'active', '', 16, '2019-03-03', 'VK3ARH'),
(769, 'VIC_3355', 'VKFF-0767', 'VK-0319', 'OC-001', '', '', 'VKP-0288', 'CAPAD_T', '3/08/1995', 'II', NULL, 'Mount Granya', 'VK3', 'AU.VI', 'SP', 'Hume', 'Wodonga - Alpine', 'Parks Victoria', 'Mount Granya State Park is a 6,140 hectares state park near Wodonga on the northern border of Victoria, Australia. It is named after Mount Granya, an 870 m peak. The terrain is generally steep and rocky with eucalyptus forest and low shrub.', 'http://parkweb.vic.gov.au/explore/parks/mount-granya-state-park', 147.283000, -36.110800, '6163.57', 'OC / VK-VIC', 'active', '', 20, '2019-11-02', 'VK3PF'),
(770, 'VIC_3344', 'VKFF-0768', 'VK-0316', 'OC-001', '', '', 'VKP-0289', 'CAPAD_T', '21/06/1988', 'II', NULL, 'Mount Lawson', 'VK3', 'AU.VI', 'SP', 'Hume', 'Wodonga - Alpine', 'Parks Victoria', 'Mount Lawson State Park is a 13,150-hectare park situated approximately 60 km east of Wodonga in the state of Victoria, Australia.', 'http://parkweb.vic.gov.au/explore/parks/mount-lawson-state-park', 147.415881, -36.078883, '13359', 'OC / VK-VIC', 'active', '', 10, '2019-11-04', 'VK3PF'),
(771, 'VIC_3345', 'VKFF-0769', 'VK-0311', 'OC-001', '', '', 'VKP-0290', 'CAPAD_T', '24/06/1987', 'II', NULL, 'Mount Napier', 'VK3', 'AU.VI', 'SP', 'Warrnambool and South West', 'Glenelg - Southern Grampians', 'Parks Victoria', 'Mount Napier State Park is a state park in the Australian state of Victoria. It is 20 km northeast of Mount Eccles; its centerpiece is Mount Napier, a true volcanic cone. The park was established in 1987, and today encompasses 2800 hectares of land.', 'http://parkweb.vic.gov.au/explore/parks/mount-napier-state-park', 142.019600, -37.906000, '2938.68', 'OC / VK-VIC', 'active', '', 4, '19/11/2016', 'VK3AAC'),
(772, 'VIC_3346', 'VKFF-0770', 'VK-0306', 'OC-001', '', '', 'VKP-0292', 'CAPAD_T', '26/04/1979', 'II', NULL, 'Mount Samaria', 'VK3', 'AU.VI', 'SP', 'Hume', 'Upper Goulburn Valley', 'Parks Victoria', 'Mount Samaria State Park is a 7,600-hectare park situated approximately 20 km north of Mansfield in the state of Victoria, Australia. The park is bounded on the western side by the Broken River and Lake Nillahcootie.', 'http://parkweb.vic.gov.au/explore/parks/mount-samaria-state-park', 146.085457, -36.880943, '7445', 'OC / VK-VIC', 'active', '', 19, '2019-05-03', 'VK6MB'),
(773, 'VIC_3347', 'VKFF-0771', 'VK-0302', 'OC-001', '', '', 'VKP-0293', 'CAPAD_T', '16/05/1978', 'III', NULL, 'Mount Worth', 'VK3', 'AU.VI', 'SP', 'Latrobe - Gippsland', 'Baw Baw', 'Parks Victoria', 'Mount Worth State Park is a state park in Victoria, Australia. It is located 15 km south of Warragul in the western Strzelecki Ranges.', 'http://parkweb.vic.gov.au/explore/parks/mount-worth-state-park', 145.992900, -38.284900, '1031.86', 'OC / VK-VIC', 'active', '', 6, '14/12/2017', 'VK3PF'),
(774, 'VIC_3348', 'VKFF-0772', 'VK-0285', 'OC-001', '', '', 'VKP-0297', 'CAPAD_T', '27/10/1989', 'II', NULL, 'Paddys Ranges', 'VK3', 'AU.VI', 'SP', 'Ballarat', 'Maryborough - Pyrenees', 'Parks Victoria', 'Paddys Ranges State Park, near Maryborough, 170 kilometres northwest of Melbourne, Australia comprises 2,010 hectares of native vegetation. Gold mining and eucalyptus oil production within the park date back to the 1840s but have long closed down.', 'http://parkweb.vic.gov.au/explore/parks/paddys-ranges-state-park', 143.697600, -37.090000, '2015.30', 'OC / VK-VIC', 'active', '', 11, '2019-05-16', 'VK6MB'),
(775, 'VIC_3368', 'VKFF-0773', 'VK-0269', 'OC-001', '', '', 'VKP-0300', 'CAPAD_T', '2/05/1986', 'II', NULL, 'Reef Hills', 'VK3', 'AU.VI', 'SP', 'Hume', 'Wangaratta - Benalla', 'Parks Victoria', 'Reef Hills State Park is a protected area of 2013 hectares, about 5 km south-west of Benalla, in the north east of Victoria, Australia. There are traces of a mining activity from the gold rush. It was established in 1986.', 'http://parkweb.vic.gov.au/explore/parks/reef-hills-state-park', 145.940265, -36.608556, '2005', 'OC / VK-VIC', 'active', '', 17, '2019-10-15', 'VK3PF'),
(776, 'VIC_3351', 'VKFF-0774', 'VK-0212', 'OC-001', '', '', 'VKP-0307', 'CAPAD_T', '1/12/1975', 'III', NULL, 'Warrandyte', 'VK3', 'AU.VI', 'SP', 'Melbourne - Outer East', 'Manningham - East', 'Parks Victoria', 'Warrandyte State Park is a state park, located in Warrandyte, east of Melbourne, Victoria on the banks of the Yarra River and surroundings.', 'http://parkweb.vic.gov.au/explore/parks/warrandyte-state-park', 145.271600, -37.710800, '682.14', 'OC / VK-VIC', 'active', '', 10, '2019-12-28', 'VK3TKK'),
(777, 'VIC_3352', 'VKFF-0775', 'VK-0208', 'OC-001', '', '', 'VKP-0308', 'CAPAD_T', '16/05/1978', 'III', NULL, 'Werribee Gorge', 'VK3', 'AU.VI', 'SP', 'Melbourne - West', 'Melton - Bacchus Marsh', 'Parks Victoria', 'Werribee Gorge State Park is a state park in Victoria, Australia. It is located near Bacchus Marsh and is popular with bushwalkers and rock climbers, all attracted to its spectacular views and significant geological features.', 'http://parkweb.vic.gov.au/explore/parks/werribee-gorge-state-park', 144.359000, -37.662300, '564.99', 'OC / VK-VIC', 'active', '', 19, '2019-08-02', 'VK6MB'),
